import logo from './logo.svg';
import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Route, Routes, Link, Switch} from "react-router-dom"; 
import NavBAr from './components/NavBar'

function App() {
  return (
    <div className="App">
      <NavBar>
        <Router>
          <Routes>
            <Route path='/' element={<Home />} />
          </Routes>
        </Router>
      </NavBar> 
    </div>
  );
}

export default App;
